angular.module('ae.datafree.tpls', []).run(['$templateCache', function($templateCache) {$templateCache.put('datafree-pager.html','<ul class="datafree-pager">\n    <li ng-if="$pager.showFirst" ng-class="{\'disabled\': $pager.currentPage == 1}">\n        <a href="javascript:void(0);" ng-click="$pager.currentPage > $pager.maxPages && $pager.first()"\n           ng-disabled="$pager.currentPage == 1"\n           ng-class="{\'disabled\': $pager.currentPage == 1}">\n            {{ $pager.firstLabel }}\n        </a>\n    </li>\n    <li ng-if="$pager.showPrev" ng-class="{\'disabled\': $pager.currentPage == 1}">\n        <a href="javascript:void(0);"  ng-click="$pager.currentPage > $pager.maxPages && $pager.prev()"\n           ng-disabled="$pager.currentPage == 1" ng-class="{\'disabled\': $pager.currentPage == 1}">\n            {{ $pager.prevLabel }}\n        </a>\n    </li>\n    <li ng-if="$pager.currentPage > $pager.numberLimit">\n        <a href="javascript:void(0);" ng-click="$pager.skipBack();">\n            &hellip;\n        </a>\n    </li>\n    <li ng-repeat="number in $pager.numbers" ng-class="{\'active\': $pager.currentPage == number}">\n        <a href="javascript:void(0);" ng-click="$pager.currentPage != number && $pager.page(number)"\n           ng-class="{\'active\': $pager.currentPage == number}">\n            {{ number }}\n        </a>\n    </li>\n    <li ng-if="$pager.currentPage <= $pager.maxPages - $pager.numberLimit">\n        <a href="javascript:void(0);"\n           ng-click="$pager.skipForward();">\n            &hellip;\n        </a>\n    </li>\n    <li ng-if="$pager.showNext" ng-class="{\'disabled\': $pager.currentPage == $pager.maxPages}">\n        <a href="javascript:void(0);" ng-click="$pager.currentPage < $pager.maxPages && $pager.next()"\n           ng-disabled="$pager.currentPage == $pager.maxPages"\n           ng-class="{\'disabled\': $pager.currentPage == $pager.maxPages}">\n            {{ $pager.nextLabel }}\n        </a>\n    </li>\n    <li ng-if="$pager.showLast" ng-class="{\'disabled\': $pager.currentPage == $pager.maxPages}">\n        <a href="javascript:void(0);" ng-click="$pager.currentPage < $pager.maxPages && $pager.last()"\n           ng-disabled="$pager.currentPage == $pager.maxPages"\n           ng-class="{\'disabled\': $pager.currentPage == $pager.maxPages - 1}">\n            {{ $pager.lastLabel }}\n        </a>\n    </li>\n</ul>');}]);